// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// Import the AggregatorV3Interface from Chainlink
import "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

/**
 * @title GoldPriceConsumer
 * @dev This contract fetches the current price of gold (XAU) in USD from Chainlink's price feed.
 */
contract GoldPrice {
    // Chainlink Aggregator for XAU/USD
    AggregatorV3Interface public priceFeed;

    /**
     * @dev Sets the price feed address for the XAU/USD feed.
     * @param _priceFeed Address of the XAU/USD price feed on the selected network.
     * mainnet-bsc 0x86896fEB19D8A607c3b11f2aF50A0f239Bd71CD0
     * testnet-bsc 0x4E08A779a85d28Cc96515379903A6029487CEbA0
     */
    constructor(address _priceFeed) {
        priceFeed = AggregatorV3Interface(_priceFeed);
    }

    /**
     * @notice Fetches the latest price of gold in USD.
     * @return price The latest price of 1 ounce of gold in USD, scaled by 10**8.
     */
    function getLatestGoldPrice() public view returns (int256 price) {
        (, price, , , ) = priceFeed.latestRoundData();
        return price;
    }
}

